import dotenv from "dotenv";
dotenv.config({ path: '.env' });

const config = {
    backendContanerName: process.env.BACKEND_CONTAINER_NAME,
    backendPort: process.env.BACKEND_API,
};

console.log(config.backendContanerName)
console.log(config.backendPort)

export default config;
